import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';
import * as ReactBootstrap from "react-bootstrap";
import TableList from './components/TableList';

const App = () => {
    const [players, setPlayers] = useState([]);
    const [loading, setLoading] = useState(false);

    const getPlayerData = async () => {
        try {
            const data = await axios.get(
            "https://nba-players.herokuapp.com/players-stats"
            )
            setLoading(true);
            console.log(data)
            setPlayers(data.data)
        }catch(e) {
            console.log(e)
        }
    };

    const columns  = [
        { datafield: "name", text: "Name"},
        { datafield: "points_per_game", text: "Supplier"},
        { datafield: "team_name", text: "Product Type"},
        { datafield: "team_name", text: "Brand"},
        { datafield: "team_name", text: "Batch Tracked"},
        { datafield: "team_name", text: "Available"},
        { datafield: "team_name", text: "Status"},
    ];

    useEffect(() => {
        getPlayerData();
    }, []);

  return (
    <div className="App">
       <TableList />
    </div>
  )
}

export default App;
